import React from "react";



const Register = ()=>{
    return(
        <>
        <h1 className="display-p1 text-light bg-primary">Register</h1>
        <div className="container">
            <div className="row">
                <div className="col-lg-4 offset-lg-4">
                    <form>
                       <input autoFocus className="form-control mb-4" placeholder="Enter Your Email"/> 
                       <input className="form-control mb-4" placeholder="Enter Your Password"/>
                       <button className="btn btn-primary col-12">Register</button>
                    </form>
                </div>
            </div>
        </div>
        </>
    )
}

export default Register;
